ads.description:
Witam serdecznie, sprzedaję własne auto Hyndai I40, które zakupiłem w polskim salonie i regularnie serwisowałem w ASO, na co posiadam faktury i wpisy w książce serwisowej.
Hyundai jest w bardzo ładnym stanie, zarówno wizualnym jak i technicznym, nie brał udziału w kolizji czy wypadku, lakier oryginalny na całym nadwoziu.
Technicznie nie odbiega stanem od nowego, skrzynia płynnie zmienia biegi, bez szarpnięć i innych niepokojących oznak zużycia. Silnik pracuje równo, brak jakichkolwiek wycieków czy zapoceń olejowych. Zawieszenie również nie wybite, bez luzów, ciche i w pełni sprawne. W ostatnim czasie wymieniony olej w silniku wraz z filtrami, tarcze hamulcowe i klocki. Obecnie auto nie wymaga wkładu fionansowego.
I40 to bardzo przestronne i wygodne auto, idealne dla rodziny, oraz osób, które cenią sobie komfort i bezpieczeństwo w podróży a przy tym jest bardzo ekonomiczne.
Hyundai posiada bardzo bogate wyposażenie, miedzy innymi na pokładzie znajduje się:
- klimatronik dwustrefowy;
- podgrzewane fotele przednie w trzech stopniach intensywności;
- podgrzewana kierownica;
- duży dotykowy wyświetlacz radia 10 cali, największy jaki był dostępny dla tego modelu;
- CarPlay i Android Auto działają bezprzewodowo;
- nawigacja;
- kamera cofania;
- rejestrator jazdy wraz z możliwością wyświetlania na ekranie zapisywanego obrazu;
- fotel kierowcy elektrycznie sterowany;
- nowe opony wielosezonowe na aucie;
- aluminiowe felgi;
- wielofunkcyjna kierownica;
- światła w technologii led;
- hak, wykorzystywany tylko do przewożenia bagażnika rowerowego;
- i wiele innych elementów wyposażenia, które podnoszą komfort oraz bezpieczeństwo podróżowania.
Zapraszam wszystkich zainteresowanych do oglądania na żywo, jest możliwość wykonania jazdy próbnej, udostępniam auto celem weryfikacji jego stanu na stacji diagnostycznej na koszt kupującego. Auto nie ma słabych stron, zarówno pod kątem wizualnym jak i technicznym.
